import React, { Fragment } from 'react';

 const Header = (selection) => {

    const sel = { selection }
    return(
    <Fragment>
        <h1>${sel}</h1>
        <h1>{'btn ' + ((`${selection}` === 'Applications') ? 'btn-primary' : 'btn-outline-primary')}</h1>
        <div class="d-flex flex-row justify-content-center">
            <div className="p-2">
                <a className={'btn ' + ((`${selection}` === 'Applications') ? 'btn-primary' : 'btn-outline-primary')} href="#" role="button">
                    Applications
                </a>
            </div>
            <div className="p-2"><a class={'btn ' + ((`${selection}` === 'Vendors') ? 'btn-primary' : 'btn-outline-primary')} href="#" role="button">Vendors</a></div>
            <div className="p-2"><a class={'btn ' + ((`${selection}` === 'Other') ? 'btn-primary' : 'btn-outline-primary')} href="#" role="button">Other</a></div>
        </div>
    </Fragment>);
};

export default Header;
